import React, { Component } from "react";

class Title extends Component {
  constructor(props) {
    super(props);
    this.bandera = true;
    this.objeto = [
      {
        id: 1,
        nombre: "Carlos",
        apellido: "Rivera",
      },

      {
        id: 2,
        nombre: "Ariel",
        apellido: "Gaitan",
      },

      {
        id: 3,
        nombre: "Kendall",
        apellido: "Ocampo",
      },
    ];
  }
  render() {
    return (
      <div className="center">
        {this.objeto.map((el) => (
          <ol>
            <ul>{el.nombre}</ul>
            <ul>{el.nombre}</ul>
            <ul>{el.id}</ul>
          </ol>
        ))}
        ;
      </div>
    );
  }
}

export default Title;
